import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import { BrowserRouter as Router } from 'react-router-dom'
import Header from './component/Header'


ReactDOM.render(
  <React.StrictMode>
    <Router>
      <Header />
      <App />
      <div> Foooter </div>
    </Router>
  </React.StrictMode>,
  document.getElementById("root")
);
